import { Box, Container } from "@mui/material"
import possibilityImage from '../assets/possibility.png'








export const Possibility=()=>{
const imgStyle={
    maxHeight:'100%',
    maxWidth:'100%'
}
    return(
        <>
        <Container maxWidth={"lg"}>
            <Box>
                <Box sx={{width:'100%'}}>
                    <img src={possibilityImage} />


                </Box>


            </Box>


        </Container>
        
        </>
    )
}
